window.bookSummaryJSON = "<p>When 17-year-old Laurel Harper decides to go live with her estranged father and step-family, she's unaware of the fact that her fate was already sealed the day she was born. She is now exactly where some higher power wants her to be. But it's not until she meets the proud and mysterious Sam Laurens that she feels something strange is going on. </p> <p>Why does he keep interfering in her life? Then Laurel finds out about Sam's ominous ancestry and a whole different fear arises. Fear of who Sam really is. Fear of her own feelings. And when she learns the dark truth about her own future, a sinister secret that will change everything as soon as she turns 19, she wants to run and hide, but soon realizes that there is no hiding from fate. </p> <p>Sam may be the only one who can help her escape her destiny, but then she has to start trusting him again, and time is of the essence because he has his own fate to deal with. Still, Sam is determined to stop Laurel from meeting her doom, even if that means he has to make a drastic move that will separate them for good.</p> <p><i>Contains mature themes.</i></p>"; 
